import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Users from "./user/pages/Users";
import NewPlace from "./places/pages/NewPlace";

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Users />} />
        <Route path="/" element={<Users />} />
        <Route path="*" element={<Users />} />
      </Routes>
    </Router>
  );
};

export default App;
